import React from "react";
import Investor from "../Entity/Investor";
// import { Container, Dropdown, DropdownButton, DropdownItem } from "react-bootstrap";
import DropdownButton from "react-bootstrap/DropdownButton";
import DropdownItem from "react-bootstrap/DropdownItem";
import Container from "react-bootstrap/Container";

type InvestorDetailsProps = {
    investor: Investor
}

function InvestorDetails(props: InvestorDetailsProps) {

    return (
        <div className="InvestorDetails">
            <h2>{props.investor.firm_name} Details</h2>

            <Container>
            <DropdownButton id="asset-selector" title="Asset Type" variant="danger">
                <DropdownItem>Private Equity</DropdownItem>
                <DropdownItem>Private Debt</DropdownItem>
                <DropdownItem>Real Estate</DropdownItem>
                <DropdownItem>Infrastructure</DropdownItem>
                <DropdownItem>Natural Resources</DropdownItem>
                <DropdownItem>Hedge Funds</DropdownItem>
            </DropdownButton>
            </Container>

            <Container>
            <table>
                <thead>
                    <tr>
                        <th>Firm ID</th>
                        <th>Firm Type</th>
                        <th>Date Added</th>
                        <th>Address</th>
                    </tr>
                </thead>
                <tr>
                    <td>{props.investor.firm_id}</td>
                    <td>{props.investor.firm_type}</td>
                    <td>{props.investor.date_added.toLocaleString()}</td>
                    <td>{props.investor.address}</td>
                </tr>
                <tbody>
                </tbody>
            </table>
            </Container>
        </div>
    );
}

export default InvestorDetails;
